import React,{Component} from 'react';
import {
    Route,
    Router,
    Link,NavLink,
    BrowserRouter,
    StaticRouter,
    Switch,
    HashRouter
} from 'react-router-dom';
import './static/css/index.css';
import Home from "./component/home.jsx";



class App extends Component{

    render() {
      return (
          <BrowserRouter>
             <div>
                 <Home />
             </div>
          </BrowserRouter>
      )
  }
}

export default App;
